import react from "react";
import styled from "styled-components";
import theme from "../../Logic/theme";

const { primary, secondar, tri, quad, background, primaryColor } = theme;

const Container = styled.div`
  width: calc(100% - 0.35em);
  margin-left: 0.5em;
  height: 6.5em;
  grid-area: save;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  row-gap: 0.25em;
`;

const SaveContainer = styled.div`
  width: 11em;
  height: 2.5em;
  background-color: #fff;
  border: solid 3px ${primary};
  border-radius: 5px;
`;

const StyledP = styled.p`
  color: ${background};
`;

const SaveRolls = ({ saves }) => {
  const renderedSaves = saves.map((saves) => {
    return (
      <SaveContainer key={`${saves.name} save roll container`}>
        <StyledP key={`${saves.name} label`}>{saves.name}</StyledP>
      </SaveContainer>
    );
  });
  return <Container>{renderedSaves}</Container>;
};

export default SaveRolls;
